description.text:
This was a very, very simple openSCAD script, and I highly recommend it anytime something doesn't quite fit on your bed.  You can modify the cube parameter to the size of your bed and place any .stl file you want to cut up in your openSCAD directory.  Then just trial-and-error it into the spot you want, hit f6 to render, and export your new, perfectly sized .stl file. :)  
For this chop it only took the following lines of code.  
<code >intersection(){  
    cube(150);  
    translate([75,200,0]) import("Body_withheadphonehole.stl");  
}  </code>
I also sliced up some half versions for even smaller print beds.  Those scripts are in the comments.

Usage afaics identical as in openscad;  
<code >oshw_logo_2d(diameter);  </code>
And diameter defaults to 10mm. There is also an .stl in there.
